import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";

import DailyLog from "../daily-log";

const GroupedLog = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const [myData, setMyData] = useState([])
    const getKeyByValue = (object, value) => {
        return Object.keys(object).find(key =>
            object[key] === value);
        console.log("sss", object + value)
    };
    const getObjects = () => {
        console.log("cdrsData", cdrsData);
        Object.keys(cdrsData).forEach(
            (e) => {
                console.log(`key=${e}  value=${cdrsData[e]}`)
            }
        )
    };

    const _renderPics = (group) => {
        return Object
            .keys(group)
            .map((key, index) => (
                <div key={index}>
                    <h3>{key.replace('Pics', '')}</h3>
                    {group[key].map((pic, i) => (
                        <div key={i}>title: {pic.title}, url: {pic.url}</div>
                    ))}
                </div>
            ));
    }
    useEffect(() => {
        getObjects();
        setMyData(cdrsData);

    }, [cdrsData])

    return (
        <React.Fragment>
            {
                Object.values(myData).forEach((obj, index) => {
                    if (obj !== undefined)
                        console.log("obj[index]", obj)
                    return (
                        obj !== undefined ? obj.map((item, i) => {
                            console.log("iteeeeeeeeeeeeeeem", item)
                            return (
                                <DailyLog key={i} item={item}/>
                            )
                        }) : null
                    )


                })
            }

        </React.Fragment>
    );

};


export default GroupedLog;
